/**
 * Constantes para el ambiente de desarrollo.
 */
export const environment = {

  /**
   * Identifica el tipo de ambiente
   */
  production: false,

  /**
   * Url base del API de pokemón.
   */
  POKEMON_API: 'https://pokeapi.co/api/v2/'
};

